'''Đèo Phú Mỹ''' trên [[quốc lộ 27]] ở vùng giáp ranh huyện [[Lâm Hà]] và huyện [[Đam Rông]] tỉnh [[Lâm Đồng]], Việt Nam <ref name =BandoHc >Tập bản đồ hành chính Việt Nam. Nhà xuất bản Tài nguyên – Môi trường và Bản đồ Việt Nam. Hà Nội, 2013.</ref><ref name =Bd50-cb01 >Bản đồ tỷ lệ 1:50.000 tờ C-49-1-A. Cục Đo đạc và Bản đồ Việt Nam, 2013.</ref>.

== Vị trí ==
Đèo Phú Mỹ trên [[quốc lộ 27]] ở vùng giáp ranh xã [[Phú Sơn, Lâm Hà|Phú Sơn]] huyện [[Lâm Hà]] và xã [[Đạ KNàng|Đạ K'Nàng]] huyện [[Đam Rông]] tỉnh [[Lâm Đồng]] <ref name =Bd50-cb01 />.

Đèo cách trung tâm hành chính xã [[Phú Sơn, Lâm Hà|Phú Sơn]] cỡ 6&nbsp;km, cách thị trấn [[Đinh Văn]] cỡ 25&nbsp;km về hướng tây bắc.

